import React from 'react';

import '../App.css';

const Member = ({ member }) => {
  return (
    <div className="flex flex-row" key={member.id}>
      <div className="flex-col-1">
        <a href={`/members/${member.id}`}>{member.first_name} {member.last_name}</a>
      </div>
      <div className="flex-col-2">
        <a href={member.short_url} target="_blank">{member.short_url}</a>
      </div>
      <div className="flex-col-1">
        {member.friends}
      </div>
    </div>
  );
}

export default Member;
